import React from 'react'

const TrendingCoin = ({ coin }) => {
    return (
        <div className='bg-white flex-col flex p-2 rounded-2xl w-full items-center'>
            <img className='w-16 ' src={coin.large} alt='logo'/>
            <div className='font-medium text-lg'>{coin.name}</div>
        </div>
    )
}

const TrendingCoinList = ({ TrendingJSON }) => {
    var arrTrending = []
    TrendingJSON.forEach((coin) => {
        arrTrending.push(<TrendingCoin coin={coin} key={coin.id}/>)
    })
    return (
        <div className='h-screen p-6 space-y-6'>
            {arrTrending}
        </div>
    )
}

const Home = ({ TrendingJSON }) => {
    return (
        <div className='bg-blue-700'>
            <TrendingCoinList TrendingJSON={TrendingJSON}/>
        </div>
    )
}

export default Home
